import SearchBar from "./SearchBar";
import About from "./About";
import { NavLink } from "react-router-dom";

const Nav = ({onSearch}) =>{
return(
    <div>
        <SearchBar onSearch={onSearch}/>
        <button>
            <NavLink to={About}>About me!</NavLink>
        </button>
        <button>
            <NavLink to='/'>Home</NavLink>
        </button>
    </div>
)
}

export default Nav
